import React from "react";
import Head from "next/head";
import Layout from "../components/Layout";

const Home = () => (
  <div>
    <Head>
      <title>Home</title>
      <link rel="icon" href="/favicon.ico" />
    </Head>

    <Layout title="About Me">
      <h1>About Me</h1>

      <p>I am a programming trainer and software developer from Austria.</p>

      <p>
        I'm working primarily in the areas of <em>frontend web development</em>{" "}
        and <em>Python programming</em>.<br />
        Tools I use include Python, JavaScript, Node.js, and React.
      </p>
    </Layout>
  </div>
);

export default Home;
